INSERT INTO multimedias VALUES(2,'The Fundamentals of Caring    ',0,'   1 hora, 37 min.',49,'BoJack Horsemg para la plataforma digital Netflix. Trata la historia de BoJack un caballo antropomorfo que triunfó en los años 1990 con una telecomedia y que actualmente es incapaz de reconducir su vida profesional y personal. A través de un marco ambientado en el mundo del espectáculo de Hollywood los episodios abordan complejos conflictos personales y tienen un hilo narrativo serializado');
INSERT INTO multimedias VALUES(3,'Rebirth       ',1,'   1 hora, 40 min.',81,'Antes de meterse en el mundo de la comedia estuvo trabajando en una compañía telefónica de Los Ángeles. Su familia le pidió que siguiera en su puesto para poder mantenerse económicamente sin embargo decidió dar un paso adelante a pesar de los riesgos que acarrearía su mala situación económica puesto que acabó perdiendo su casa y el coche');
INSERT INTO multimedias VALUES(4,'Tallulah      ',2,'   1 hora, 51 min.',65,'Su particular estilo divertido y animado lo ha convertido en uno de los comediantes más exitosos con eventos con boletos agotados en todo el mundo inclusive agotando boletos en Madison Square Garden y el Microsoft Theater. Además es unos de los comediantes más vistos en YouTube con más de 300 millones de vistas');
INSERT INTO multimedias VALUES(5,'XOXO  ',0,'   1 hora, 32 min.',73,'Rarcásticas de sus canciones hasta cierto punto políticamente incorrectas han conseguido que sus vídeos de YouTube hayan alcanzado más de 522 millones de vistas.2? Su primer EP Bo Fo Sho fue publicado en junio de 2008 por el sello Comedy Central Records y su primer LP homónimo fue lanzado por la misma discográfica en marzo de 2009. En septiembre de 2010 publica su álbum Words Words Words incluyendo una actuación en directo y dos canciones de estudio');
INSERT INTO multimedias VALUES(6,'ARQ   ',2,'   1 hora, 28 min.',76,'Giuseppe Piero Grillo (Génova Italia 21 de julio de 1948) más conocido como Beppe Grillo es un cómico actor y político italiano que trabaja en el cine la televisión y el teatro. También es blogger y su blog1? cuenta con el mayor número de visitas entre los blog de lengua italiana siendo una de las páginas web italianas más visitadas con más de 160.000 visitas diarias.2? En 2009 fue cofundador del Movimiento 5 Estrellas');
INSERT INTO multimedias VALUES(7,'The Siege of Jadotville       ',4,'   1 hora, 48 min.',58,'Ever Aftecreadas previamente por Mattel (inspiradas por su otra franquicia Monster High). La serie trata sobre las historias de los hijos adolescentes de personajes famosos de cuentos de hadas clásicos canciones de cuna y mitos griegos que estudian en una escuela-internado llamada Ever After High. En algunos casos los libros son escritos por Suzanne Selfors pero la mayoría de ellos suelen ser escritos por Hale ya que originalmente es la autora de la serie. Técnicamente no es una serie de televisión en los Estados Unidos ya que es una serie Web. Sin embargo la serie es transmitida en la televisión de Francia por el canal infantil francés Gulli. Ever After High es considerada apta para todo el público');
INSERT INTO multimedias VALUES(8,'I Am the Pretty Thing That Lives in the House',1,'    ',32,'El Sunnyv rivalidades y la delincuencia están al orden del día pero en la que también es posible formar una familia tener amigos y encontrar el amor... siempre y cuando tenga uno claro que la familia le va a hacer la vida imposible el amor le va a amargar la existencia y los amigos acabarán por llevarle a la tumba.');
