INSERT INTO multimedias VALUES(74,'Into the Inferno     ',3,'   1 hora, 47 min.',27,'Iglesias nació en San Diego bajo el apellido «Iglecias» ?rebautizado a propósito por su madre después de que el padre se desentendiera de él incluso en el momento del parto?. Sin embargo el actor decidió adoptar la escritura correcta (Iglesias) en su vida diaria. Como el más joven de seis hermanos encontró en la comedia una forma de enfrentar los problemas. A lo largo de su infancia se crio junto a su madre en varias localidades californianas: Riverside Corona Santa Ana Baldwin Park y Compton hasta que finalmente encontró residencia fija en Long Beach');
INSERT INTO multimedias VALUES(75,'The Ivory Game       ',0,'   1 hora, 52 min.',30,'Burnham solicitó entrar en la Universidad del sur de California la prestigiosa Universidad de Yale3? aunque fue aceptado en la Universidad de Nueva York5? en la escuela de artes. Bo dijo que el primer año de universidad se quería morir mientras veía como sus antiguos amigos montaban fiestas. En una entrevista de 2011 dijo que llevaba con su novia 5 años');
INSERT INTO multimedias VALUES(76,'Casting JonBenet     ',3,'   1 hora, 20 min.',87,'Ever Aftecreadas previamente por Mattel (inspiradas por su otra franquicia Monster High). La serie trata sobre las historias de los hijos adolescentes de personajes famosos de cuentos de hadas clásicos canciones de cuna y mitos griegos que estudian en una escuela-internado llamada Ever After High. En algunos casos los libros son escritos por Suzanne Selfors pero la mayoría de ellos suelen ser escritos por Hale ya que originalmente es la autora de la serie. Técnicamente no es una serie de televisión en los Estados Unidos ya que es una serie Web. Sin embargo la serie es transmitida en la televisión de Francia por el canal infantil francés Gulli. Ever After High es considerada apta para todo el público');
